CREATE TABLE IF NOT EXISTS event_type (
  evt_id  INTEGER            NOT NULL
, evt_type        CHARACTER VARYING  NOT NULL
, sub_type    CHARACTER VARYING
, event_name  CHARACTER VARYING  NOT NULL
, handler     CHARACTER VARYING
, CONSTRAINT event_type_pkey PRIMARY KEY (evt_id)
);

CREATE SEQUENCE IF NOT EXISTS evt_seq;


ALTER SEQUENCE evt_seq RESTART WITH 377;

